import "./App.css";
import * as React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './components/EC2Dashboard.css';
import EC2Dashboard from './components/EC2Dashboard';


function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route exact path="/dashboard" component={EC2Dashboard} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
